const serviceReferralMethod = {"resourceType":"CodeSystem","id":"service-referral-method","meta":{"lastUpdated":"2022-05-28T13:47:40.239+11:00","profile":["http://hl7.org/fhir/StructureDefinition/shareablecodesystem"]},"text":{"status":"generated","div":"<div xmlns=\"http://www.w3.org/1999/xhtml\">\n      \n      <h2>ReferralMethod</h2>\n      \n      <div>\n        \n        <p>The methods of referral can be used when referring to a specific HealthCareService resource.</p>\n\n      \n      </div>\n      \n      <p>This code system http://terminology.hl7.org/CodeSystem/service-referral-method defines the following codes:</p>\n      \n      <table class=\"codes\">\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">\n            \n            <b>Code</b>\n          \n          </td>\n          \n          <td>\n            \n            <b>Display</b>\n          \n          </td>\n          \n          <td>\n            \n            <b>Definition</b>\n          \n          </td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">fax\n            \n            <a name=\"service-referral-method-fax\"> </a>\n          \n          </td>\n          \n          <td>Fax</td>\n          \n          <td>Referrals may be accepted by fax.</td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">phone\n            \n            <a name=\"service-referral-method-phone\"> </a>\n          \n          </td>\n          \n          <td>Phone</td>\n          \n          <td>Referrals may be accepted over the phone from a practitioner.</td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">elec\n            \n            <a name=\"service-referral-method-elec\"> </a>\n          \n          </td>\n          \n          <td>Secure Messaging</td>\n          \n          <td>Referrals may be accepted via a secure messaging system. To determine the types of secure messaging systems supported, refer to the identifiers collection. Callers will need to understand the specific identifier system used to know that they are able to transmit messages.</td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">semail\n            \n            <a name=\"service-referral-method-semail\"> </a>\n          \n          </td>\n          \n          <td>Secure Email</td>\n          \n          <td>Referrals may be accepted via a secure email. To send please encrypt with the services public key.</td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">mail\n            \n            <a name=\"service-referral-method-mail\"> </a>\n          \n          </td>\n          \n          <td>Mail</td>\n          \n          <td>Referrals may be accepted via regular postage (or hand delivered).</td>\n        \n        </tr>\n      \n      </table>\n    \n    </div>"},"extension":[{"url":"http://hl7.org/fhir/StructureDefinition/structuredefinition-wg","valueCode":"pa"},{"url":"http://hl7.org/fhir/StructureDefinition/structuredefinition-standards-status","valueCode":"draft"},{"url":"http://hl7.org/fhir/StructureDefinition/structuredefinition-fmm","valueInteger":1}],"url":"http://terminology.hl7.org/CodeSystem/service-referral-method","identifier":[{"system":"urn:ietf:rfc:3986","value":"urn:oid:2.16.840.1.113883.4.642.4.1142"}],"version":"4.3.0","name":"ReferralMethod","title":"ReferralMethod","status":"draft","experimental":false,"date":"2021-01-17T07:06:13+11:00","publisher":"HL7 (FHIR Project)","contact":[{"telecom":[{"system":"url","value":"http://hl7.org/fhir"},{"system":"email","value":"fhir@lists.hl7.org"}]}],"description":"The methods of referral can be used when referring to a specific HealthCareService resource.","caseSensitive":true,"valueSet":"http://hl7.org/fhir/ValueSet/service-